import { Component } from '@angular/core';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {

  Username!:string;
  Password!:string;

  login(){
    alert("user logged in successfully");
  }

}
<p>login works!</p>

<table border="5" [cellPadding]="5" [cellSpacing]="5">
    <tr><td><label>Enter your UserName <input type="text" [(ngModel)]="Username"></label></td></tr>
    <tr><td><label>Enter your Password <input type="text" [(ngModel)]="Password"></label></td></tr>

</table>
<div>
    <button (click)="login()">Login</button>

</div>
